#include <stdio.h>

int		myft_strlen(const char *s)
{
	unsigned	x;
	int			len;

	len = 0;
	while (1)
	{
		x = *(unsigned*)s;
		if ((x & 0xFF) == 0)
			return (len);
		if ((x & 0xFF00) == 0)
			return (len + 1);
		if ((x & 0xFF0000) == 0)
			return (len + 2);
		if ((x & 0xFF000000) == 0)
			return (len + 3);
		s += 4;
		len += 4;
	}
}

int		ft_strlen(char *s)
{
	int i;

	i = 0;
	while (s[i] != '\0')
		i++;
	return (i);
}


